import React, { useState, useEffect } from 'react';
import { Table, Image, message } from 'antd';
import axios from 'axios';

const ListarAjustadores = () => {
  const [ajustadores, setAjustadores] = useState([]);

  useEffect(() => {
    const fetchAjustadores = async () => {
      try {
        const response = await axios.get('http://localhost:8000/Ajustadores/ConsultarAjustadores');
        setAjustadores(response.data);
      } catch (error) {
        console.error('Error al obtener los ajustadores:', error);
        message.error('No se pudo obtener la lista de ajustadores.');
      }
    };

    fetchAjustadores();
  }, []);

  const columns = [
    {
      title: 'Nombres',
      dataIndex: 'Nombres',
      key: 'Nombres',
    },
    {
      title: 'Apellidos',
      dataIndex: 'Apellidos',
      key: 'Apellidos',
    },
    {
      title: 'Edad',
      dataIndex: 'Edad',
      key: 'Edad',
    },
    {
      title: 'Sexo',
      dataIndex: 'Sexo',
      key: 'Sexo',
    },
    {
      title: 'Teléfono',
      dataIndex: 'Telefono',
      key: 'Telefono',
    },
    {
      title: 'Correo Electrónico',
      dataIndex: 'Correo_Electronico',
      key: 'Correo_Electronico',
    },
    {
      title: 'Kilometraje Inicial',
      dataIndex: 'Kilometraje_Inicial',
      key: 'Kilometraje_Inicial',
    },
    {
      title: 'Número de Llave',
      dataIndex: 'Numero_De_Llave',
      key: 'Numero_De_Llave',
    },
    {
      title: 'Modelo del Vehículo',
      dataIndex: 'Modelo_Vehiculo',
      key: 'Modelo_Vehiculo',
    },
    {
      title: 'Placa del Vehículo',
      dataIndex: 'Placa_Vehiculo',
      key: 'Placa_Vehiculo',
    },
    {
      title: 'Modelo del Celular',
      dataIndex: 'Modelo_Celular',
      key: 'Modelo_Celular',
    },
    {
      title: 'IMEI',
      dataIndex: 'IMEI',
      key: 'IMEI',
    },
    {
      title: 'Foto de Perfil',
      dataIndex: 'Foto_Perfil',
      key: 'Foto_Perfil',
      // render: (text) => <Image width={50} src={text} />,
      render: (text) => <Image width={50} src={`http://localhost:8000/${text}`} />,
    },
    {
      title: 'Tarjeta de Gasolina',
      dataIndex: 'Tarjeta_Gasolina',
      key: 'Tarjeta_Gasolina',
    },
  ];

  return (
    <Table columns={columns} dataSource={ajustadores} rowKey="id" />
  );
};

export default ListarAjustadores;
